(25, 'CELT English A2', '{\"ops\":[{\"insert\":\" \"},{\"attributes\":{\"color\":\"#444444\"},\"insert\":\"Can understand sentences and frequently used expressions related to areas of most immediate relevance (e.g. very basic personal and family information, shopping, local geography, employment). Can communicate in simple and routine tasks requiring a simple and direct exchange of information on familiar and routine matters. Can describe in simple terms aspects of his/her background, immediate environment and matters in areas of immediate need\"},{\"insert\":\"\\n\"}]}', NULL, 41, '300', 72, 1, 100, 'A2-Elementary', '2019-07-30 01:33:13', '2019-08-17 14:04:13', '/resources/course/avatar/25/1566025267.jpg'),
(26, 'CELT English A1', '{\"ops\":[{\"attributes\":{\"color\":\"#444444\"},\"insert\":\"Can understand and use familiar everyday expressions and very basic phrases aimed at the satisfaction of needs of a concrete type. Can introduce him/herself and others and can ask and answer questions about personal details such as where he/she lives, people he/she knows and things he/she has. Can interact in a simple way provided the other person talks slowly and clearly and is prepared to help.\"},{\"insert\":\"\\n\"}]}', NULL, 42, '300', 72, 1, 100, 'A1-Beginner', '2019-08-01 17:05:44', '2019-08-17 14:03:40', '/resources/course/avatar/26/1566025175.jpg'),
(27, 'CELT English B1', '{\"ops\":[{\"attributes\":{\"color\":\"#444444\"},\"insert\":\"Can understand the main points of clear standard input on familiar matters regularly encountered in work, school, leisure, etc. Can deal with most situations likely to arise whilst travelling in an area where the language is spoken. Can produce simple connected text on topics which are familiar or of personal interest. Can describe experiences and events, dreams, hopes & ambitions and briefly give reasons and explanations for opinions and plans.\"},{\"insert\":\"\\n\"}]}', NULL, 40, '300', 72, 1, 100, 'B1- Pre-Interme', '2019-08-17 14:04:57', '2019-08-17 14:04:57', '/resources/course/avatar//1566025497.jpg'),
(28, 'CELT English B1+', '{\"ops\":[{\"attributes\":{\"color\":\"#444444\"},\"insert\":\"Can understand the main points of clear standard input on familiar matters regularly encountered in work, school, leisure, etc. Can deal with most situations likely to arise whilst travelling in an area where the language is spoken. Can produce simple connected text on topics which are familiar or of personal interest. Can describe experiences and events, dreams, hopes & ambitions and briefly give reasons and explanations for opinions and plans.\"},{\"insert\":\"\\n\"}]}', NULL, 39, '300', 72, 1, 100, 'B1+  Intermedia', '2019-08-17 14:05:46', '2019-08-17 14:05:46', '/resources/course/avatar//1566025546.jpg'),
